import React, { useState } from 'react';
import axios from 'axios';
import {
	BrowserRouter as Router,
	Routes,
	Route,
	NavLink,
	Outlet,
	useParams,
	useLocation,
} from 'react-router-dom';

import SubProjectLinks from '../subProjectLinks/SubProjectLinks';

const ProjectTitle = (props) => {
	const project = props.project;

	useEffect(() => {
		axios
			.get(`http://localhost:8000/wp-json/custom-api/v1/get_nav_items`)
			.then((res) => {
				console.log(res.data[0].projects);
				setProjects(res.data[0].projects);
			})
			.then(() => setLoaded(true));
	}, []);

	return (
		<div>
			<NavLink to={`/project/${project.slug}/`} onClick={props.handleClick}>
				<div
					onClick={() => {
						props.projectClick(project.slug, project.id);
					}}
				>
					{project.title}
				</div>
			</NavLink>

			{props.open ? (
				<SubProjectLinks
					projectSlug={project.slug}
					subProjects={props.subProjects}
				/>
			) : null}
		</div>
	);
};

export default ProjectTitle;
